import React from 'react';
//import { TwitterTweetEmbed } from "react-twitter-embed";

/*
const Tweet = ({json}) => {
    //need to map
    const {id} = json.data;
    
    const options = {
        cards: "hidden",
        align: "center",
        width: "550",
        conversation: "none",
      };

    return <TwitterTweetEmbed options={options} tweetId={id} />;
};

*/

const Tweet = ({tweets}) => (
    
    <div>
        {tweets.map((thistweet, key) => 
        <div className="tweet" key={key}>
            <p>ID {thistweet.id}</p>
            <p>{thistweet.text}</p>  
        </div> 
        )}
    </div>   
       
)

export default Tweet;
